import React from 'react';
import logo from './logo.svg';
import './App.css';
import image from './images/images.png'

function App() {
  return (
      <div>
        <header>
          <h1>
            <h1>Trusted by Industry Leading Organisations</h1>
            <img src={image} className='img' />
          </h1>
        </header>
      </div>
  );
}

export default App;
